visitScheduleRule:
"use strict";
({ params, imports }) => {
    const programEncounter = params.entity;
    const moment = imports.moment;
    const scheduleBuilder = new imports.rulesConfig.VisitScheduleBuilder({programEncounter});
    const encounterType = programEncounter.encounterType.name;

    const currentFollowupName = programEncounter.name;

    let num = parseInt(currentFollowupName.split(' ').pop());
    if(isNaN(num)) {
        num = 1;
    } else {
        num++;
    }
    let nextFollowupName = `Lead Farmer Monitoring Follow-up ${num}`;

    const isAlreadyScheduled = programEncounter.programEnrolment.getEncountersOfType(encounterType)
        .some(encounter => encounter.name == nextFollowupName);

    const alreadyFiveVisitsAreScheduled = programEncounter.programEnrolment.getEncountersOfType(encounterType).length >= 5;

    const isProgramActive = programEncounter.programEnrolment.programExitDateTime == null;

    if(!isAlreadyScheduled && isProgramActive && !alreadyFiveVisitsAreScheduled){
        const earliestDate = moment(programEncounter.earliestVisitDateTime).add(30, 'days').startOf('day').toDate();
        const maxDate = moment(earliestDate).add(7, 'days').endOf('day').endOf('day').toDate();
        scheduleBuilder.add({name: nextFollowupName, encounterType: encounterType, earliestDate, maxDate});  
    }

    return scheduleBuilder.getAll();
};
